$(document).ready(function () {

    let news = [
        ['data:image/jpeg;base64,', 'Benagil Sea Cave', 'Algarve, Portugal', 'Portugal’s southern coast is lined with incredible beaches and caves. To see the most beautiful, head to Algarve and check out the famous Benagil Sea Cave.'],
        ['data:image/jpeg;base64,', 'Blue Lagoon Island', 'Bahamas', 'The private and incredibly scenic island boasts one of the best beaches in the Bahamas.'],
        ['data:image/jpeg;base64,', 'Great Barrier Reef', 'Australia', 'Located off the coast of Tropical North Queensland in Australia, the Great Barrier Reef is the largest living thing on Earth.'],
        ['data:image/jpeg;base64,', 'Kauai', 'Hawaii, USA', 'Kauai in Hawaii is famous for its unbelievably beautiful coastlines, of which 17 miles is included in the amazing Na Pali Coast State Park.'],
        ['data:image/jpeg;base64,', 'Machu Pichu', 'Peru', 'Machu Picchu is a destination that tops many bucket lists and with good reason.'],
   
    ];
    

        for (i = 0; i < news.length; i++) {
            var mname = news[i][1];
            var place = news[i][2];
            var des = news[i][3];
            var images = news[i][0];
                
                    $(` <div class="card-body">
                    <div class="card" style="background:url(${images});background-position:center;background-size:cover;"></div>
                    <p class="cardhead">${mname},<br><span>${place}</span></p> 
                    <p class="carddes">${des}</p> 
                </div>`).appendTo('#cards');
            
        }
  

});